import React from 'react';
import ReactDOM from 'react-dom/client';
import './Styling/index.css';
import App from './Components/App';
import {BrowserRouter} from 'react-router-dom';


const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <React.StrictMode>
        <svg width="100%" height="100%" style={{position: 'fixed', border: 'solid 2px red', left: 0, top: 0}}>
            {/* <circle cx="50" cy="50" r="40" stroke="green" stroke-width="4" fill="yellow" />  */}
            <path d="M244.33-97.52s444,322.52,0,947.85H479s96-715.17-26.67-956.25Z" id='path1' />
            <path d='M434-22.68l11,837.36H-269s415-163,445-448S44-22.68,44-22.68Z' id='path2'/>
        </svg>
        <BrowserRouter>
            <App />
        </BrowserRouter>
    </React.StrictMode>
);
